Utilisation
Prérequis
Pour utiliser la librairie Lunatic, la Web application cliente doit supporter React 16.8 +
Installation de la librairie
Lunatic est publiée sur NPM.
# Ajout de la dépendance
yarn add @inseefr/lunatic
